import React from "react";

// Importing the Bootstrap CSS 
import "bootstrap/dist/css/bootstrap.min.css";
import "./app-styles.css"

// Importing React Router
import {Route, Switch} from "react-router-dom";

import Header from "../components/header/Header";
import Footer from "../components/footer/Footer";
import Aktuelles from "./Akutelles/Aktuelles";
import Weingut from "./weingut/Weingut";
import Geschichte from "./weingut/Geschichte";


function App() {
  return (
    <div>

      <Header />
      <Switch>


      <Route path="/home" component={Aktuelles} exact/>
      <Route path="/weingut" component={Weingut} />
      <Route path="/weingut/geschichte" component={Geschichte} />

      </Switch>
      <Footer />
    </div>
  );
}

export default App;
